import { Link } from 'react-router-dom';

function HomePage() {
    return (
        <div>
            <div className="breadcrumbs">
                <a href="/">Главная</a>
            </div>
            <h1 className="title">Ozon</h1>
            <Link to='/products'>Каталог</Link>
        </div>
    );
}

export default HomePage;
